INSERT INTO `wp_posts` VALUES (1,1,'2017-08-18 09:32:44','2017-08-18 09:32:44','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2017-08-18 09:32:44','2017-08-18 09:32:44','',0,'http://localhost/gettimee/?p=1',0,'post','',1),(2,1,'2017-08-18 09:32:44','2017-08-18 09:32:44','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/gettimee/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2017-08-18 09:32:44','2017-08-18 09:32:44','',0,'http://localhost/gettimee/?page_id=2',0,'page','',0),(40,1,'2017-09-05 04:22:03','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2017-09-05 04:22:03','0000-00-00 00:00:00','',0,'http://gettimee.ekuiva.com/?p=40',0,'post','',0),(4,1,'2017-08-18 15:02:40','2017-08-18 15:02:40','','Homepage','','publish','closed','closed','','homepage','','','2017-08-25 10:29:34','2017-08-25 10:29:34','',0,'http://localhost/gettimee/?page_id=4',0,'page','',0),(5,1,'2017-08-18 15:02:40','2017-08-18 15:02:40',''