/td>\r\n                </tr>\r\n                <tr style=\"background: #fff;\">\r\n                    <td colspan=\"2\" style=\"padding: 30px;font-size: 12px;color: #555;\">\r\n                        <p><b>Hai Admin!</b></p>\r\n\r\n                        <p>You get a new message to Contact Us, with the following data:</p>\r\n\r\n                        <p><b>Full Name</b></p>\r\n                        <p>[your-name]</p>\r\n\r\n                        <p><b>Email</b></p>\r\n                        <p>[your-email]</p>\r\n\r\n                        <p><b>Phone</b></p>\r\n                        <p>[your-company-contact-number]</p>\r\n\r\n                        <p><b>Subject</b></p>\r\n                        <p>Subject Message</p>\r\n\r\n                        <p><b>Massage</b></p>\r\n                        <p>[your-message-for-request]</p>\r\n\r\n                        <p>Please reply to email to notify information to customer.</p>\r\n\r\n                        <p><b>Best Regards,</b></p>\r\n\r\n                        <p><b>GetTimee</b></p>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td colspan=\"2\" style=\"padding: 0;\"><span style=\"margin: 0; color: #fff;\"><img alt=\"\" src=\"http://gettimee.ekuiva.com/wp-content/uploads/2017/09/footer.png\"></span>\r\n                    </td>\r\n                </tr>\r\n                </tbody>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n    </tbody>\r\n</table>\r\n</body>\r\n</html>\nReply-To: info@gettimee.com\n\n1\n\n1\nGetTimee, Thanks for the message.\nGetTimee <info@timeeapp.com>\n[your-email]\n<html>\r\n<head>\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=windows-1252\">\r\n</head>\r\n<body>\r\n<table style=\"margin: 1em; font-family: sans-serif;\" width=\"531\" border=\"0\" cellspacing=\"1\" cellpadding=\"0\">\r\n    <tbody style=\"background: lightgrey; \">\r\n    <tr>\r\n        <td width=\"410\"></td>\r\n      